For traceability, it is useful to be able to get the list of dependencies from a build binary. This allows, for example, auditing for known vulnerability directly on the binary files. This is not done by default in Rust builds, but you can use cargo auditable to include this information. cargo auditable build --release You can then see the embedded data with rust-audit-info : $ rust-audit-info my_program | jq
{ "packages": [ { "name": "aho-corasick", "version": "0.7.20", "source": "registry", "dependencies": [ 83 ], "features": [ "default", "std" ] } # [...]
} Warning : Due to the way some -sys crate work , some C/C++ native library may be included in the binary but not visible in the embedded data.
